class Solution {
public:
	list<int>l;
	int merger(int val)
	{
		int n = l.size();
		//incase of minimum or first element
		if (l.empty() or l.front() >= val)
		{
			l.push_front(val);
			return 0;
		}
		//incase of largest element
		if (l.back() <= val)
		{
			l.push_back(val);
			return 0;
		}
		//incase it is in the middle
		int same = 0, less = 0, more = 0;
		for (auto it = l.begin(); it != l.end(); it++)
		{
			int e = *(it);
			if (e < val)
			{
				less++;
			}
			else if (e == val)
			{
				same++;
			}
			else
			{
				l.insert(it, val);
				break;
			}
		}
		more = n - less - same;
		return min(less, more);
	}


	int createSortedArray(vector<int>&v) {
		int sum = 0;
		int n = v.size();
		int ma = 1e9 + 7;
		for (int i = 0; i < n; i++)
		{
			sum = (sum % ma + merger(v[i]) % ma) % ma;
		}
		return sum % ma;


	}
};
